import React from "react"
import "./Stylesheets/form.css"
import form from "../Assets/form_background.png"
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";

export default class FormToReg extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            "identity_name": null,
            "identity_class": null,
            "identity_year": null,
            "anon-name": false,
            "anon-class": false,
            "anon-year": false,

        }
        this.years = ["2016-2017", "2017-2018", "2018-2019", "2019-2020", "2020-2021", "2021-2022"]

    }

    render() {
        return (
            <div id="form">

                <form>
                    <div>
                        <img src={form} id="form-bg"></img>
                    </div>
                </form>
            </div>
        )
    }

}
